import React from 'react';

export default function Account() {
  return (
    <div style={{ maxWidth: '600px', margin: '0 auto', padding: '24px', border: '1px solid #eee', borderRadius: '8px' }}>
      <h1 style={{ marginBottom: '16px' }}>Account</h1>
      <p>Welcome to your account page. You can manage your profile and settings all in one place.</p>
    </div>
  );
}
